                    />
                    <input
                    type="text"
                    //value={mobileNumber}
                    placeholder="Mobile Number"
                    //onChange={(e) => setMobileNumber(e.target.value)}
                    />

                    <button type="submit">Create</button>

                    
                </form>
            </div>
        )
    }
}

export default AddPatient;
